import React from 'react'
import ReactDOM from 'react-dom' 

// ReactDOM.render('kya dikhana hai',
// 'kaha dikhana hai','callback func')
const name="Komal Saluja"
const date = new Date();

ReactDOM.render(
  <React.Fragment>
 <h1 contentEditable="false">{`my name is ${name}`}</h1>
  <p>Current Date is : {date.toLocaleDateString()}</p>
  <p>Current Time is : {date.toLocaleTimeString()}</p>

  </React.Fragment>,

  document.getElementById('root')
);
